import React from 'react';
import "./styles.scss";

export class Payload extends React.Component{
    constructor(props){
        super(props);
        console.log(props);
        this.state = {
            payloads: props.payloads
        }
    }

    render(){
        //console.log(this.state.payloads);
        const payloadMap = this.state.payloads.map((payload) => {
            return (<li>
                    <h4>ID: {payload.payload_id}</h4>
                    <h4>Type: {payload.payload_type}</h4>
                    <h4>Nationality: {payload.nationality}</h4>

                </li>
            );
        })
        return(
            <div className="payloads">
                <ul>

                {payloadMap}

                </ul>
            </div>
        )
    }
}
